            <div className="header">
                <div className="option">
                    <Link to='/'>Home</Link>
                </div>
                <div className="option">
                    <Link >About</Link>
                </div>
                <div className="option">
                    <Link >Contacts</Link>
                </div>
                
            </div>
);
            
   
export default Header;
